import React, { Component } from 'react'
import { BrowserRouter as Router, Route, Routes, useHistory, Redirect, useNavigate } from 'react-router-dom'

import Home from './components/Home'
import Facturas from './components/Facturas'
import Ordenes from './components/Ordenes'
import Reports from './components/Reports'
import Clientes from './components/Clientes'
import Vehiculos from './components/Vehiculos'
import Puertos from './components/Puertos'
import Tarifas from './components/Tarifas'
import DatosEmpresa from './components/DatosEmpresa'
import Dashboard from './components/Dashboard'
import Login from './components/Login'

function requireAuth(nextState, replace, next) {
  if (this.state.loggedIn) {
    replace({
      pathname: "/login",
      state: {nextPathname: nextState.location.pathname}
    });
  }
  next();
}

export default class App extends Component {

  constructor() {
    super();
    this.state = {
      properties: [],      
      loggedIn: false,
      time: new Date().getSeconds()
    };
  }

  render() {
    console.log("app state:", this.state.loggedIn);
    return (
      <Router>        
          <Routes>
            <Route exact path="/" element={<Login />}/>
            <Route exact path="/Dashboard" element={<Login />}/>
            <Route exact path="/Facturas" element={<Login />}/>
            <Route exact path="/Ordenes" element={<Login />}/>
            <Route exact path="/Reportes" element={<Login />}/>
            <Route exact path="/Clientes" element={<Login />}/>
            <Route exact path="/Vehiculos" element={<Login />}/>
            <Route exact path="/Puertos" element={<Login />}/>
            <Route exact path="/Tarifas" element={<Login />}/>
            <Route exact path="/DatosEmpresa" element={<Login />}/>


            <Route exact path="/Login" element={<Login />}/>
          </Routes>        
      </Router>
    );
  }
}
